const float period = 121.24;

vec4 slice_sample(sampler2D ch, vec2 p, float pzi)
{
    return texture(ch, get_sampling_pos(p, pzi)/iResolution.xy);
}

vec4 trilinear(sampler2D ch, vec3 p)
{
    float pzi = floor(p.z);
    float pzf = fract(p.z);
    return mix(slice_sample(ch, p.xy, pzi), slice_sample(ch, p.xy, pzi + 1.0), pzf);
}

vec4 trilinear_smooth(sampler2D ch, vec3 p)
{
	vec3 ip = floor(p);
	vec3 fp = fract(p);
    return trilinear(ch, ip + fp*fp*(3.0-2.0*fp));
}

vec4 sampleEmbed(sampler2D ch, vec3 uv, float offset)
{
    vec3 p = vec3((1.0 - uv.yx) * vec2(embed_size.xyz-3) + 2.0, uv.z * float(embed_size.z+2))  + offset + 0.5;
    return trilinear_smooth(ch, p);
}

vec3 decode(vec3 uv)
{
    uv.x = 1.0 - uv.x;
    if(uv.x < 0.0 || uv.x > 1.0 || uv.y < 0.0 || uv.y > 1.0) return vec3(0.0);
    vec4 e0_0 = sampleEmbed(iChannel0, uv, 0.0);
    vec4 e0_1 = sampleEmbed(iChannel1, uv, 0.0);
    vec4 e0_2 = sampleEmbed(iChannel2, uv, 0.5);
    vec4 e0_3 = sampleEmbed(iChannel3, uv, 0.5);

    vec3 res = model(e0_0, e0_1, e0_2, e0_3);
    return res / (abs(res) + 1.0) + 0.5;
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = 1.0*((fragCoord - vec2(iResolution.x - iResolution.y, 0)*0.5)/iResolution.y - 0.5) + 0.49999;

    //vec3 col = sampleEmbed(iChannel1, uv, 0, 0.0).xyz;
    vec3 col = decode(vec3(uv, mod(iTime, period)/period)); 
    col = smoothstep(vec3(0.0), vec3(1.0), col);
    fragColor = vec4(col,1.0);
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    ivec3 p = get_coord(fragCoord);

    if(is_outside(p) || iFrame > 8) discard;

    if(is_edge(p))
    {
        fragColor = vec4(0.0);
    }
    else
    {
        fragColor = get_embed(embed_quant_0, 0, p-1);
    }
}

